import React from "react";

export function Examenes(props) {
    const data = [['Covid 19','Examen Isopado '],['Antiquenos','sadad lkjadslkj']]
  return (
    <div className="container  min-h-screen">
      <button className="m-4 bg-green-primary py-2 px-4 rounded-lg text-white text-lg"> + Agregar Examen</button>

      <table className="bg-white w-8/12 mx-auto mt-6 rounded-t-lg">
        <thead className="bg-blue-primary text-white rounded-t-lg">
          <tr className="text-xl rounded-t-lg">
            <th className="rounded-tl-lg">Examen</th>
            <th className="rounded-tr-lg">Descripcion</th>
          </tr>
        </thead>
        <tbody className="text-center">
          {data.map((element,i) => {
            if(i%2===0){
                return (
                    <tr className="text-white">
                      <td>{element[0]}</td>
                      <td>{element[1]}</td>
                    </tr>
                  );
            }
            return (
                <tr className="text-gray-500">
                  <td>{element[0]}</td>
                  <td>{element[1]}</td>
                </tr>
              );
          })}
        </tbody>
      </table>
    </div>
  );
}
